import React from "react";
import {
  Container,
  Flex,
  FlexItem,
  FlexCentered
} from "../styles/general/General.styled";
import { SignUpImage } from "../styles/SignInOut.styled";
import Navbar from "./general/Navbar";
import { Form, Formik } from "formik";
import FormikTextField from "../../utils/FormikTextField";

const SignInOut = () => {
  const initialValues = {
    firstName: "",
    lastName: "",
    email: "",
    password: "",
    passwordConfirm: ""
  };

  return (
    <>
      <Navbar />
      <Container
        p="10rem 4rem"
        mh="100vh"
        bgColor="rgba(224, 247, 250, 0.8)"
        h="60%">
        <Flex bgColor="#f3e5f5" h="60vh" br="6rem">
          <FlexItem fg="1" h="60vh">
            <SignUpImage />
          </FlexItem>
          <FlexItem w="75%">
            <FlexCentered>
              <Formik
                initialValues={initialValues}
                onSubmit={(values, { setSubmitting, resetForm }) => {
                  setTimeout(() => {
                    setSubmitting(false);
                    // dispatch(registerUser(values));
                    resetForm();
                  }, 1500);
                }}></Formik>
            </FlexCentered>
          </FlexItem>
        </Flex>
      </Container>
    </>
  );
};

export default SignInOut;
